(window.webpackJsonp=window.webpackJsonp||[]).push([[11],{D1lT:function(e){e.exports=JSON.parse('{"department":"Under the Button","text":["Under the Button is Penn’s go-to source for daily humor and satire.","Our writing staff works around the clock to report on the stories that other media organizations wouldn’t dare touch due to editorial standards. Our video and media staff work to capture the real Penn experience through the lens of a camera we stole from the DP. ","We are looking for talented writers, videographers, actors, graphic designers, coders, our dignity, ten gay rats, and your best brisket recipe. If you’re an all-around funny person looking for a way to subject the rest of campus to your sense of humor, we’re the publication for you."],"signup":"https://forms.gle/Y7byjWB3qNfmAq5j7","highlights":["Wax and Trump in Heated Competition to Bring Most Shame to Penn","Photo Essay: These Are All the Places on Campus I Would Kiss My Girlfriend If I Had One","Choose Your Own Adventure: Will You Fuck Jeff From Writing Sem?","Pool Party Man on the Street"],"highlight-links":["https://www.underthebutton.com/article/2019/07/wax-trump-shame-penn","https://www.underthebutton.com/article/2019/09/if-i-had-a-girlfriend-photo-essay","https://www.underthebutton.com/article/2018/12/choose-your-own-adventure-jeff-writing-sem-intro","https://youtu.be/Or5lGThQTJU"]}')},ZWty:function(e){e.exports=JSON.parse('[{"department":"Marketing","text":["DP Marketing works on developing and enhancing the brand identity of The Daily Pennsylvanian Inc., a $3 million dollar business. Our associates work to create social media campaigns, events, and merchandise that showcase the content of the DP, 34th Street Magazine, and Under the Button. We work closely with all departments in the DP. Associates are also given the resources and opportunities to plan and execute their own marketing projects to promote any section of the publication.","Marketing is the perfect place to develop both your creativity and your business skills because all our projects require a good mix of both. No prior experience is required — just a willingness to learn about branding, promotion, and merchandising. Join us to gain some business experience and be a part of this great organization!"],"highlights":["Battle of the Bands","UTB Comedy Night","Puck Frinceton T-shirt Sale"],"highlight-links":["https://www.facebook.com/events/2205915566180909/","https://www.facebook.com/events/2137326212971575/","https://www.facebook.com/events/440490923254900/"],"background":"linear-gradient(rgba(238, 238, 238, 0.9), rgba(238, 238, 238, 0.9)), url(\'https://snworksceo.imgix.net/dpn/5803b1e8-72a6-4810-9770-60123f4a066d.sized-1000x1000.jpg\')","id":"marketing"},{"department":"Consulting","text":["Consulting analysts source potential clients, develop strategic marketing campaigns, and produce pitch materials for client presentations. By working with our outstanding business teams, DP consultants will learn to use creative problem solving and analytical skills to help our clients successfully reach the Penn community.","The Consulting Team also runs many initiatives between the other Ivy League newspapers and facilitates collaborative Ivy-wide efforts. The analysts will often find themselves speaking to other analysts from different schools and will often find themselves working in teams with people they may have never met before. The consulting team promotes quick thinking and strong teamwork."],"highlights":["DP Consultants helped clients during the COVID-19 pandemic develop social media strategies to keep up with customers while away from campus."],"highlight-links":[],"background":"linear-gradient(rgba(238, 238, 238, 0.8), rgba(238, 238, 238, 0.8)), url(\'https://snworksceo.imgix.net/dpn/7f265244-68c1-4483-b138-8fc49c343444.sized-1000x1000.jpg\')","id":"consulting"},{"department":"Tech","text":["Both mobile & web developers at the DP have the opportunity to work on a number of diverse and complex projects. The DP runs multiple full-stack apps, regularly creates standalone pages for special issues or interactive projects, and builds internal tools for both the editorial and business sides.","As a web developer, you\'ll get experience working with GitHub, as well as a wide array of programming languages. We use React, GatsbyJS, and NextJS for our project pages, Express, Apollo, and GraphQL for our backend servers, and regularly build tools with JavaScript, Python, and Ruby.","As a mobile developer, you\'ll get experience working with React Native and improve upon the DP mobile app which is soon to be released.","Developers who are experienced in HTML, CSS, Javascript are encouraged to join!"],"highlights":["DP Projects, a full list of all project pages we\'ve developed","DP mobile GraphQL Server","DP+: DP Mobile App","Check out all of our open source work on our GitHub"],"highlight-links":["https://projects.thedp.com/","https://github.com/dailypenn/jay","https://github.com/dailypenn/canada-goose","https://github.com/dailypenn"],"background":"linear-gradient(rgba(238, 238, 238, 0.8), rgba(238, 238, 238, 0.8)), url(\'https://snworksceo.imgix.net/dpn/85611786-a619-4496-9c5c-59ece6432fa5.sized-1000x1000.jpg\')","id":"web"},{"department":"Analytics","text":["DP Analytics is the data science and business analytics hub of the Daily Pennsylvanian. In Analytics, we seek to leverage modern tools and technologies to enhance the digital and data analytics capabilities of the DP.","Analytics staffers have the option to work in one of two sub-departments: Core Data Science and Product Analytics. Examples of data science projects include ML-driven recommendation engines and natural language processing analyses of DP articles. Examples of product analytics projects include market segmentation and search engine optimization (SEO).","Whether it’s deeply technical machine learning work or cross-functional business analytics initiatives (or both!), DP Analytics staffers work on projects with direct impact on the DP, the Penn community, and a global readership audience. Apply today!"],"highlights":["ML Driven Content Based Recommendation Engine","Advertisement Optimization Through Ad Network Redesign","Geo-based Interactive Dashboard To Facilitate Circulation Path Diagnosis and Analy"],"highlight-links":[],"background":"linear-gradient(rgba(238, 238, 238, 0.8), rgba(238, 238, 238, 0.8)), url(\'https://snworksceo.imgix.net/dpn/68726eb4-7df0-4e26-9d83-3ad542d33846.sized-1000x1000.jpg\')","id":"analytics"},{"department":"Product Lab","text":["The DP Product Lab Department’s main focus is to create marketing content for local businesses. As the company develops, we explore new fields and build new services. We hold responsibility for developing innovative products and coming up with revenue-generating initiatives. Some projects we are involved in include Best of Penn, Summer at Penn, and the Dining Guide. Positions in product lab range from creative writing, marketing, design, web development, and analytics. If you have interdisciplinary interests, this may be the perfect department for you!","Our weekly commitment is approximately 6 hours."],"highlights":["Verb Energy Bars Sponsored Video","Meet Parvis and his micro-world at Woven Treasures","Which Gia Pronto Kitchen salad are you?"],"highlight-links":["https://www.facebook.com/dailypenn/videos/vb.6356558804/10155858850708805/","https://www.thedp.com/article/2018/04/sponsored-woven-treasures-video","https://www.thedp.com/article/2017/11/sponsored-gia-pronto-quiz"],"background":"linear-gradient(rgba(238, 238, 238, 0.8), rgba(238, 238, 238, 0.8)), url(\'https://snworksceo.imgix.net/dpn/af307706-8ed7-4389-bb37-283cdb2af2d0.sized-1000x1000.jpg\')","id":"product-lab"},{"department":"Circulation","text":["Circulation staffers are the DP\'s street team, and they are the ones you see handing out papers on Locust Walk and across campus every day.","If you\'re friendly, dependable, and loud—and want to earn $10 an hour—this is the department for you. Join an incredible team with a great culture filled with good times and social activities."],"highlights":[],"highlight-links":[],"background":"linear-gradient(rgba(238, 238, 238, 0.8), rgba(238, 238, 238, 0.8)), url(\'https://snworksceo.imgix.net/dpn/06837fc5-f166-414c-8785-9234e35205b0.sized-1000x1000.jpg\')","id":"circulation"}]')},alOa:function(e){e.exports=JSON.parse('{"department":"34th Street Magazine","text":["34th Street Magazine is your authority on Penn student life. We are a student magazine that empowers student voices, sheds light on student issues, and provides timely commentary on the arts and campus culture. We provide endless opportunities for a creative outlet: you can write cover stories, help envision marketing campaigns, design and lay out issues, attend press movie screenings, review top-rated restaurants, and even pitch your own content ideas.","As the hub for Penn voices and narrative, Street staffers cover arts, culture, and feature content. We are looking for writers, photographers, videographers, artists, and social media whizzes to create, package, and promote Street to the Penn audience. Writers can work for our Features, Focus, Style, Arts, Film & TV, Music, or Ego sections. Multimedia staffers work with either the Photo or Video departments. Illustrators and graphic designers create visuals, including our weekly print product, as part of the Design department. Audience Engagement associates manage our social media and our newsletter, The Toast.","Street provides writers the opportunity to be creative in their pursuit of journalism, teaches Audience Engagement staff how to build and promote a brand online, and gives photographers, videographers, and illustrators experience in creating engaging editorial visuals. Join Street to be part of a tight–knit community and learn from some of the most interesting and dedicated people at Penn—we promise you won’t regret it."],"signup":"https://docs.google.com/forms/d/e/1FAIpQLScSV2BWW1rIEIjMHWeytQ8vIwdULlt7t6aiit63afwW8MWIJQ/viewform","highlights":["‘You Can’t Not Take That Home’: Penn Nurses on the Emotional Toll of Coronavirus","LEADERSHIP, COMMITMENT, AND SCHOLARSHIP: PRESENTING THE CLASS OF 2020 PENN 10","Why I Left Greek Life—And Joined CAFSA","Is TikTok creating a musical meritocracy?","From Houston Hall to the Pennsylvania House of Representatives"],"highlight-links":["https://www.34st.com/article/2020/04/covid-coronavirus-healthcare-essential-workers-nurses-ppe-protection-masks-hospitals-penn","https://www.34st.com/article/2020/05/penn-10-profiles-2020-university-of-pennsylvania-34th-street-magazine-special-issue","https://www.34st.com/article/2020/02/upenn-why-i-left-greek-life-cafsa-wots","https://www.34st.com/article/2020/07/tiktok-music-streaming-spotify-record-label-penelope-scott-yoza-lizzy-mcalpine","https://www.34st.com/article/2020/07/rick-krajewski-upenn-alum-west-philadelphia-state-representative"]}')},vSpO:function(e){e.exports=JSON.parse('[{"department":"News","text":["By joining News, you will learn not only how to report and investigate stories relevant to Penn’s campus and students, but also the intricacies of student life and University operations. Reporters uncover news important to the Penn community by illuminating student stories and holding institutions accountable. Whether it’s breaking news or investigative journalism, your storytelling has the ability to enact real change on campus.","The Real-Time Desk is also housed in the News department and is for those who want to report on breaking news and write aggregated news posts with a lesser time commitment.","Follow in the footsteps of DP News alumni who work for publications like The New York Times, Politico, Vox, and The Washington Post, to name a few. No journalistic experience required — only curiosity and dedication."],"highlights":["Penn Med staff among first frontline healthcare workers in U.S. to receive COVID-19 vaccine","Penn Police superintendent utters expletives, accidentally interrupting U. Council meeting","Penn Med\'s frontline health care workers praised for courage, yet denied COVID-19 tests","Students demand Penn fire anthropology professor who used Nazi phrase and salute","Live Updates — More than 1,000 ballots cast at Houston Hall, ARCH, Walnut Street Library"],"highlight-links":["https://www.thedp.com/article/2021/01/covid-19-vaccine-rollout-penn-health-system-staff-researchers-pennsylvania","https://www.thedp.com/article/2020/12/penn-university-council-open-forum-maureen-rush-expletive-comment","https://www.thedp.com/article/2020/12/routine-testing-penn-healthcare-workers","https://www.thedp.com/article/2021/01/penn-professor-hitler-nazi-salute-anthropology-reactions-fire","https://www.thedp.com/article/2020/11/penn-philadelphia-election-day-live-updates"],"background":"linear-gradient(rgba(170, 30, 34, 0.8), rgba(170, 30, 34, 0.8)), url(\'https://snworksceo.imgix.net/dpn/917417c6-2a39-487a-bd75-8913f3427445.sized-1000x1000.jpg\')","id":"news"},{"department":"Sports","text":["Sports are about passion — the ability to risk it all, to become emotionally invested, to be a part of a team, and to test the limits of what you’re capable of. DP Sports provides the structure and guidance you need to explore that passion.","Our department is a place where anyone can feel welcome and be a part of the family. We spend valuable time with each and every person on our team to ensure that they can sharpen their storytelling and investigative skills. We’re a team, and we have an amazing time going on road trips, throwing watch parties, and getting immersed in the sports we cover and watch.","So if you like watching, playing, reading, writing, talking, photographing, or learning about sports, DP Sports is totally the place for you. No experience necessary; absolutely anyone is welcome to join!"],"highlights":["Brodeur\'s record-breaking night sees Penn men\'s basketball through to Ivy Madness","Why didn\'t Donald Trump play sports at Penn?","Born into a celebrity family, Penn quarterback Ryan Glover forges his own path","An empty cathedral: Why aren\'t more students attending basketball games at the Palestra?","Freshman year they cried over cheese fries. Now seniors, Grasela and Sterba are captains"],"highlight-links":["https://www.thedp.com/article/2020/03/penn-mens-basketball-columbia-aj-brodeur-leading-scorer-ivy-league","https://www.thedp.com/article/2020/07/donald-trump-penn-baseball-football-squash-fordham-sats-bob-seddon","https://www.thedp.com/article/2020/06/ryan-glover-tameka-foster-penn-football-quarterback-mother-son-usher-ivy-league","https://www.thedp.com/article/2020/02/palestra-penn-mens-basketball-attendance-student-culture-ivy-league","https://www.thedp.com/article/2019/11/penn-womens-basketball-senior-leaders-grasela-sterba"],"background":"linear-gradient(rgba(170, 30, 34, 0.9), rgba(170, 30, 34, 0.9)), url(\'https://snworksceo.imgix.net/dpn/cec0e468-8fd7-4820-906d-9981ae887347.sized-1000x1000.jpg\')","id":"sports"},{"department":"Opinion","text":["You have the power to decide what the campus conversation ought to be.","At The Daily Pennsylvanian, we are looking for creative, passionate, and hard-working writers to pen columns for Penn\'s independent student-led news organization. We are also looking for talented artists to create funny, insightful, and poignant cartoons.","Your writing and reporting skills will improve tremendously, you will have the rare opportunity to reach thousands of people with every column you write, and you will learn to make this award-winning media organization your home. Opinion columns often garner the most page views of all DP sections, and columnists are known around campus. Being an opinion artist requires time and dedication, as well as the ability to make a point using few words.","Make conversation, stimulate change, and hold organizations and people accountable. Join us."],"highlights":["Surayya Walters | Stop ignoring tokenism at Penn","Alfredo Praticò | David Cohen is Wrong","Varun Saraswathula | Doctors are facing a silent mental health crisis — and they need help","Kaliyah Dorsey | At Penn, fake smiles hurt more than they help","Jessica Gooding | Paying PILOTs will save lives"],"highlight-links":["https://www.thedp.com/article/2019/11/tokenism-racism-clubs-ivy-league-upenn-philadelphia","https://www.thedp.com/article/2020/07/paying-pilots-will-save-lives-philadelphia-penn-campus","https://www.thedp.com/article/2020/07/doctors-are-facing-a-silent-mental-health-crisis-and-they-need-help-pre-medicine-med-penn-undergrad-residency","https://www.thedp.com/article/2019/04/mental-health-ivy-league-ariana-grande-jordan-peele-kaliyah-dorsey-upenn-philadelphia","https://www.thedp.com/article/2020/07/paying-pilots-will-save-lives-philadelphia-penn-campus"],"background":"linear-gradient(rgba(170, 30, 34, 0.9), rgba(170, 30, 34, 0.9)), url(\'https://snworksceo.imgix.net/dpn/63f97845-7cb5-49eb-8322-bca5667583bc.sized-1000x1000.jpg\')","id":"opinion"},{"department":"Copy","text":["The Daily Pennsylvanian’s Copy Department is now editing 34th Street, Under the Button, and DP Sports content! Join our super fun team in reviewing and fact-checking everything from breaking news to satirical videos to social media captions. Come help us keep our content concise, consistent, and considerate.","From the people who brought the DP the Oxford comma."],"highlights":["The DP\'s Official Style Guide"],"highlight-links":["https://docs.google.com/document/pub?id=14HoU_sCiPxD8SOSH8HvWKsvz1Elv89yzcje-sZGGahs&pli=1"],"background":"linear-gradient(rgba(170, 30, 34, 0.8), rgba(170, 30, 34, 0.8)), url(\'https://snworksceo.imgix.net/dpn/9a678efe-73b0-4fed-9f63-2278da389db8.sized-1000x1000.jpg\')","id":"copy"},{"department":"Design","text":["The Design Department is looking for designers, artists, and illustrators with all ranges of experience to join us in producing The Daily Pennsylvanian and 34th Street Magazine’s print and online visual content.","We use the full Adobe Creative Suite—mainly Photoshop, Illustrator, and InDesign—along with various online platforms for data visualization.","If you are interested in creating aesthetic content, whether it be front-page print centerpieces, online graphics, or layouts for websites, then the Design department is for you!"],"highlights":["The Grad Issue","Coronavirus Project Page","Opinion | Take down the George Whitefield statue","Opinion | Doctors are facing a silent mental health crisis — and they need help","34st Feature | Who Owns Locust?","34st Word on the Street | A Bumble Date That Actually Went Right"],"highlight-links":["https://issuu.com/dailypenn/docs/gradissue","https://thedp-covid-19.herokuapp.com/","https://www.thedp.com/article/2020/06/george-whitefield-statue-rizzo-columbus-racism-slavery-penn-georgia","https://www.thedp.com/article/2020/07/doctors-are-facing-a-silent-mental-health-crisis-and-they-need-help-pre-medicine-med-penn-undergrad-residency","https://www.34st.com/article/2020/02/sexual-assault-racism-harassment-fraternities-cafsa-greek-life-upenn","https://www.34st.com/article/2019/02/sydney-gelman-valentines-day-relationship-bumble-study-abroad"],"background":"linear-gradient(rgba(170, 30, 34, 0.9), rgba(170, 30, 34, 0.9)), url(\'https://snworksceo.imgix.net/dpn/90337c0f-5064-4457-917f-c728ffcf8e58.sized-1000x1000.jpg\')","id":"design"},{"department":"Multimedia","text":["As a member of the Multimedia Department, you will learn how to create engaging visual storytelling content, have the opportunity to cover historic events on campus and throughout the country, and take part in the editing and publishing processes.","In 2020, our staff notably covered Philadelphia’s Black Lives Matter protests, the presidential election throughout Pennsylvania and at the New Hampshire primaries, and explored the University’s efforts to combat COVID-19.","We use the Adobe Creative Suite, as well as high-quality DSLR cameras, lenses, and audio and video equipment. No experience with photography or videography is necessary. No personal equipment is required, but we ask you to use your own if you have it now. Join us in making transformative content for an award-winning media company!"],"highlights":["Photo Essay | Philadelphia protests for George Floyd and racial justice","Penn Democrats Deliver Mail-In Ballot Applications To Off-Campus Student Apartments","Photo Essay | Meet six Philadelphia Black-owned businesses facing the COVID-19 pandemic","Philadelphia Celebrates Biden-Harris Win","In Photos: Philadelphians rejoice in the streets as Pa. propels Biden to presidency","Penn Students On Activism And Politics In The Age Of COVID-19","Photo Essay | Meet seven essential workers keeping Penn’s campus running during the pandemic","Students Discuss The Challenges Of A Virtual Fall For Each Class Year"],"highlight-links":["https://www.thedp.com/article/2020/06/philadelphia-protests-george-floyd-black-lives-matter-photo-essay","https://www.youtube.com/watch?v=3KJrlF9T4Rc","https://www.thedp.com/article/2020/07/black-owned-businesses-philadelphia-coronavirus-black-lives-matter-photo-essay","https://www.youtube.com/watch?v=GGOQUr0pZ4o","https://www.thedp.com/article/2020/11/penn-philadelphia-celebrations-joe-biden-election-2020-pennsylvania-victory-party","https://www.youtube.com/watch?v=hguRV7U5Q94","https://www.thedp.com/article/2020/11/penn-essential-workers-coronavirus-covid19-photo-essay","https://www.youtube.com/watch?v=qxklB93jWhs"],"background":"linear-gradient(rgba(170, 30, 34, 0.8), rgba(170, 30, 34, 0.8)), url(\'https://media.giphy.com/media/KHKlf5Cnvzm1HDkVrL/giphy.gif\')","id":"multimedia"},{"department":"Audience Engagement","text":["Joining Audience Engagement will put you on the frontline of the DP’s interaction with tens of thousands of readers and develop skills increasingly relevant in the world’s growing digital landscape.","As a rapidly growing department, we are looking for people excited to curate, manage, and develop the DP’s social media presence and interaction through Facebook, Twitter and (especially!) Instagram. We are also seeking writers interested in writing and editing our daily newsletter. This year, we have created a new division under AE in partnership with Analytics for those interested in the more technical side of analyzing audience engagement data.","AE is the right department for anyone looking to work with other departments across the DP on exciting projects such as promotion strategies for special issues and events online.","No prior experience required for the social media and newsletter division — only a fire emoji game and willingness to be part of our close knit family. Familiarity or willingness to learn Google Analytics and Excel is required for the analytics division, and it’s a bonus if familiar with Python or R."],"highlights":["The Daily Pennsylvanian Facebook","The Daily Pennsylvanian Twitter","DP Sports Twitter","The Daily Pennsylvanian Instagram"],"highlight-links":["https://www.facebook.com/dailypenn","https://twitter.com/dailypenn","https://twitter.com/dailypennsports","https://www.instagram.com/dailypenn/"],"background":"linear-gradient(rgba(170, 30, 34, 0.8), rgba(170, 30, 34, 0.8)), url(\'https://snworksceo.imgix.net/dpn/4c31d16d-8363-41df-80a0-a5564b011215.sized-1000x1000.jpg\')","id":"social"},{"department":"Podcasts","text":["Calling all podcast enthusiasts! DP Podcasts is looking for new storytellers, hosts, writers, editors, and assistants! Those looking to edit podcasts or learn the behind the scenes process are especially welcomed by our hosts. Join this burgeoning department as we attempt to expand the breadth and depth of our current podcast offerings. We are looking for storytellers and commentators from diverse backgrounds.","Are you weirdly passionate about something on campus? Do you have interesting opinions? If you join our department, we can turn that into a podcast!"],"highlights":["A Legacy of Privilege, Quite Frankly","ivyQueens, Bottoms on Top","Gay Christmas, Bottoms on Top","Disoriented at Penn, 1600 Penn"],"highlight-links":["https://www.thedp.com/multimedia/63464","https://www.thedp.com/multimedia/62044","https://www.thedp.com/multimedia/61202","https://www.thedp.com/multimedia/60649"],"background":"linear-gradient(rgba(170, 30, 34, 0.8), rgba(170, 30, 34, 0.8)), url(\'https://snworksceo.imgix.net/dpn/51d7e036-6b77-402a-9d6d-b1f7b8c3ab8c.sized-1000x1000.jpg\')","id":"podcasts"}]')}}]);
